import swimmer from "../images/swimmer.png";
import wedding from "../images/wedding-photography.png";
import mountain_bike from "../images/mountain-bike.png";

export function Card() {
  return (
    <div className="card">
      <div className="card-stats">
        <img src={swimmer} alt="" className="swimmer-image"></img>
        <img src={wedding} alt="" className="wedding-image"></img>
        <img src={mountain_bike} alt="" className="mountain-bike-image"></img>
      </div>
    </div>
  );
}
